function renderArr(array) {
  console.log(array);
  for (let i = 0; i < array.length; i++) {
    const div = $(`<div class="clubs">
    <img src ="${array[i].img}">
    <div class="content">
        <h1>${array[i].clubs}</h1>
        <h1>${array[i].price}</h1>
        <a href="./buy.html"> <button class="buy">Buy</button></a>
        <button onclick=remove(${i}) class="buy">remove</button>
        </div>
    </div>`);

    mainContainer.append(div);
  }
  localStorage.setItem("team", JSON.stringify(arrClub));
}

renderArr(arrClub);

function addTeamt() {
  const newTeam = {
    clubs: clubs.val(),
    img: img.val(),
    price: price.val(),
    buy: buy.val(),
  };
  arrClub.push(newTeam);
  mainContainer.html("");
  renderArr(arrClub);
}
function remove(i) {
  console.log(i);
  arrClub.splice(i, 1);
  mainContainer.html("");
  renderArr(arrClub);
}
